INSERT INTO `emt_email_templates` (`id`, `type`, `email_subject`, `email_body`, `variable_hints`, `display_order`, `is_active`, `created_at`, `updated_at`) VALUES
(101, 'General', 'Rental Notification to Owner', '<p>Dear&nbsp;[first_name] [last_name],</p>\r\n<p>There has been&nbsp;a new reservation created. See the details below:</p>\r\n<p>Name of Property: [property]</p>\r\n<p>Arrival: [date_arrival]</p>\r\n<p>Departure: [date_departure]</p>\r\n<p>Booking&nbsp;Status: [booking_status]</p>\r\n<p>Thank you,</p>\r\n<p>Manager,</p>\r\n<p>[site_name]</p>', '[first_name], [last_name], [property], [date_arrival], [date_departure], [booking_status], [site_name]', 101, 1, '0000-00-00 00:00:00', '2015-10-02 18:43:53'),
(102, 'General', 'Rental Notification to Housekeeper', '<p>Dear&nbsp;[first_name] [last_name],</p>\r\n<p>There has been&nbsp;a new reservation created. See the details below:</p>\r\n<p>Name of Property: [property]</p>\r\n<p>Arrival: [date_arrival]</p>\r\n<p>Departure: [date_departure]</p>\r\n<p>Booking&nbsp;Status: [booking_status]</p>\r\n<p>Thank you,</p>\r\n<p>Manager,</p>\r\n<p>[site_name]</p>', '[first_name], [last_name], [property], [date_arrival], [date_departure], [booking_status], [site_name]', 102, 1, '0000-00-00 00:00:00', '2015-10-02 18:44:15'),
(103, 'General', 'Rental Notification to Service Vendor', '<p>Dear&nbsp;[first_name] [last_name],</p>\r\n<p>There has been&nbsp;a new reservation created. See the details below:</p>\r\n<p>Name of Property: [property]</p>\r\n<p>Arrival: [date_arrival]</p>\r\n<p>Departure: [date_departure]</p>\r\n<p>Booking&nbsp;Status: [booking_status]</p>\r\n<p>Thank you,</p>\r\n<p>Manager,</p>\r\n<p>[site_name]</p>', '[first_name], [last_name], [property], [date_arrival], [date_departure], [booking_status], [site_name]', 103, 1, '0000-00-00 00:00:00', '2015-10-02 18:44:38'),
(1, 'Payment', 'Reservation Booked', '<p>Hi&nbsp;[first_name],</p>\r\n<p>We are pleased to confirm&nbsp;your reservation at [site_name].</p>\r\n<p>Details of your reservation are below:</p>\r\n<p>&nbsp;</p>\r\n<p>Guest Name: [first_name] [last_name]</p>\r\n<p>Arrival: [date_arrival]</p>\r\n<p>Departure: [date_departure]</p>\r\n<p>Stay: [nights] nights</p>\r\n<p>Property Name: [property]</p>\r\n<p>Reservation Total: $[amount_total]</p>\r\n<p>Booking&nbsp;Status: [booking_status]</p>\r\n<p>&nbsp;</p>\r\n<p>[transactions_history]</p>\r\n<p>&nbsp;</p>\r\n<p>If you have any further inquiries or questions, please contact our office.</p>\r\n<p>Thank you!</p>', '[customer_email], [first_name], [last_name], [date_arrival], [date_departure], [nights], [property], [transactions_history], [amount_total], [booking_status], [site_name]', 1, 1, '0000-00-00 00:00:00', '2015-10-02 18:43:34'),
(2, 'Payment', 'Reservation Pending - Payment Request', '<p>Hi [first_name],</p>\r\n<p>We have created&nbsp;your reservation at [site_name].</p>\r\n<p>Details of your reservation are below:</p>\r\n<p>Guest Name: [first_name] [last_name]</p>\r\n<p>Arrival: [date_arrival]</p>\r\n<p>Departure: [date_departure]</p>\r\n<p>Number of Nights: [nights]</p>\r\n<p>Property Name: [property]</p>\r\n<p>[payment_records]</p>\r\n<p>Total: $[amount_total]</p>\r\n<p>Reservation Status: [booking_status]</p>\r\n<p>To make a payment please proceed to following link:</p>\r\n<p>[site_url]/payment/[uniqid]</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>If you have any further inquiries or questions, please contact our office.</p>\r\n<p>Thank you!</p>', '[customer_email], [first_name], [last_name], [date_arrival], [date_departure], [nights], [property], [payment_records], [uniqid], [amount_total], [booking_status], [site_url], [site_name]', 2, 0, '0000-00-00 00:00:00', '2015-09-23 06:52:28'),
(3, 'Payment', 'Reservation - Balance Payment is Due', '<p>Hi [first_name],</p>\r\n<p>This is a reminder that your balance payment is due for following reservation.</p>\r\n<p>Guest Name: [first_name] [last_name]</p>\r\n<p>Arrival: [date_arrival]</p>\r\n<p>Departure: [date_departure]</p>\r\n<p>Number of Nights: [nights]</p>\r\n<p>Property Name: [property]</p>\r\n<p>[payment_records]</p>\r\n<p>Total: $[amount_total]</p>\r\n<p>Reservation Status: [booking_status]</p>\r\n<p>If you have any further inquiries or questions, please contact our office.</p>\r\n<p>&nbsp;</p>\r\n<p>Thank you,</p>\r\n<p>Team,</p>\r\n<p>Eminent Vacation Rental</p>', '', 3, 0, '0000-00-00 00:00:00', '2015-09-23 06:53:11'),
(4, 'Payment', 'Reservation - Payment Error!', '<p>Hi,</p>\r\n<p>There was an error processing your credit card.</p>\r\n<p>Thank you,</p>\r\n<p>Team,</p>\r\n<p>Eminent Vacation Rental</p>', '', 4, 0, '0000-00-00 00:00:00', '2015-09-23 06:53:54'),
(5, 'Payment', 'Reservation - Rental/Guest Directions', '<p>Hi,</p>\r\n<p>This email explains instructions for&nbsp;your rental.</p>\r\n<p>&nbsp;</p>\r\n<p>Thank you,</p>\r\n<p>Team,</p>\r\n<p>Eminent Vacation Rental</p>', '', 5, 0, '0000-00-00 00:00:00', '2015-09-23 06:54:11'),
(105, 'General', 'Reset Admin Password', '<p>Hello Dear [first_name] [last_name],</p>\n<p>Please click the link below to reset your admin password.&nbsp;</p>\n<p>[reset_link]</p>\n<p>&nbsp;</p>\n<p>Thank you.</p>', '[first_name], [last_name], [reset_link]', 105, 0, '0000-00-00 00:00:00', '2015-10-02 17:35:55'),
(201, 'General', 'New Buying Offer', '<p>Hello Dear [owner_first_name] [owner_last_name],</p> <p>You have received a new buying offer for your property [property]</p><p>Please find the details below:</p><p>&nbsp;</p> <p>First Name: [first_name]<br/>Last Name: [last_name]<br/>Email: [email]</p> <p><strong>Message:</strong></p> <p>[message]</p>\r\n\r\n', '[owner_first_name], [owner_last_name], [property], [first_name], [last_name], [email], [message]', 201, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
